import React from 'react';
import { connect } from "react-redux";
import { connectUser } from '../actions/actions'
import { User } from '../user'
const axios = require('axios');

const mapStateToProps = (state) => {
    return {
      activities: state.activityList
    }
}

class ActivityList extends React.Component {
    constructor(props) {
      super(props);
      this.state = { activities: undefined };
    }

    renderList(){
        /*var Data = this.state.activities, MakeItem = function(X) {
            return <li key={X.name}>{X.name}</li>
        };
        return Data.map(MakeItem);*/
        let url = 'http://localhost:8080/user/getUser/5';
        //console.log(axios.get(url));
        let res = axios.get(url).then(response => this.setState({activities: response.data}));
        //console.log(res);
    }

    render() {
        return <div>{this.renderList()}</div>
    }
}

const ConnectedActivityList = connect(mapStateToProps)(ActivityList);

export {
    ConnectedActivityList
}
